import React from "react";
import {
  CarouselProvider,
  Slider,
  Slide,
  ButtonBack,
  ButtonNext,
} from "pure-react-carousel";
import "pure-react-carousel/dist/react-carousel.es.css";

import Mycard from "./productCard.js";

import "./productCarousel.css";

const Imagecarousel = () => {
  return (
    <div className="product-carousel">
      <div className="product-container">
        <CarouselProvider
          naturalSlideWidth={100}
          naturalSlideHeight={125}
          totalSlides={10}
          infinite
        >
          <Slider>
            <Slide index={0} style={{ width: "250px" }}>
              <Mycard cardno="1" />.
            </Slide>
            <Slide index={1} style={{ width: "250px" }}>
              <Mycard cardno="2" />
            </Slide>
            <Slide index={2} style={{ width: "250px" }}>
              <Mycard cardno="3" />
            </Slide>
            <Slide index={3} style={{ width: "250px" }}>
              <Mycard cardno="3" />
            </Slide>
            <Slide index={4} style={{ width: "250px" }}>
              <Mycard cardno="3" />
            </Slide>
            <Slide index={5} style={{ width: "250px" }}>
              <Mycard cardno="3" />
            </Slide>
            <Slide index={6} style={{ width: "250px" }}>
              <Mycard cardno="3" />
            </Slide>
          </Slider>
          <ButtonBack>Back</ButtonBack>
          <ButtonNext>Next</ButtonNext>
        </CarouselProvider>
      </div>
    </div>
  );
};

export default Imagecarousel;
